	(3,'offering_template_english','Offering Letter Template','<p>Dear [CAN_NAME],<br><br>On behalf of [COM], I am delighted to offer you the position of [JOB_TITLE]. We were impressed with your background and experience, and we believe that you will be a valuable addition to our team.<br><br>The details of your offer are as follows:<br>- Salary: [OFF_SALARY]<br>- Start Date: [START_DATE]<br>- Internship Period: 3 months<br>- Confirmation Deadline: 1 day after received this email<br>- Working Arrangement: [ARRANGEMENT]<br><br><br>WFO: Tuesday, Wednesday, Thursday<br>WFH: Monday &amp; Friday<br>Working Hours: 09.00 - 18.00<br>Address: Synergy Building, 8th Floor Unit 8 (PT Passion Abadi Korpora)<br><br>Please review this offer carefully and let us know of your decision. You can confirm your acceptance by reply to this email. Should you have any questions or need further clarification, feel free to reach out to us.<br><br>We are excited about the possibility of you joining [COM] and contributing to our success. We hope that you will accept this offer and look forward to welcoming you to the team.<br><br>Sincerely,<br><br>Krisma Bela<br>+62 889-0234-7290<br><strong>Talent Acquisition Supervisor</strong><br><strong>PT Passion Abadi Korpora</strong></p>'),
	(4,'offering_template_indonesia','Template Offering Letter','<p>Dear [CAN_NAME],<br><br>On behalf of [COM], I am delighted to offer you the position of [JOB_TITLE]. We were impressed with your background and experience, and we believe that you will be a valuable addition to our team.<br><br>The details of your offer are as follows:<br>- Salary: [OFF_SALARY]<br>- Start Date: [START_DATE]<br>- Internship Period: 3 months<br>- Confirmation Deadline: 1 day after received this email<br>- Working Arrangement: [ARRANGEMENT]<br><br><br>WFO: Tuesday, Wednesday, Thursday<br>WFH: Monday &amp; Friday<br>Working Hours: 09.00 - 18.00<br>Address: Synergy Building, 8th Floor Unit 8 (PT Passion Abadi Korpora)<br><br>Please review this offer carefully and let us know of your decision. You can confirm your acceptance by reply to this email. Should you have any questions or need further clarification, feel free to reach out to us.<br><br>We are excited about the possibility of you joining [COM] and contributing to our success. We hope that you will accept this offer and look forward to welcoming you to the team.<br><br>Sincerely,<br><br>Krisma Bela<br>+62 889-0234-7290<br><strong>Talent Acquisition Supervisor</strong><br><strong>PT Passion Abadi Korpora</strong></p>'),
