	(11,'rejected_template_english','Rejected Template English','<p>[DATE]<br><br>[CAN_NAME]<br>[CAN_ADDRESS]<br><br>Dear [CAN_NAME],<br><br>On behalf of [COM], I would like to extend my gratitude for your interest in the [JOB_TITLE] position at our company. We appreciate the time and effort you invested in the application process.<br><br>After careful consideration, we regret to inform you that we have decided not to move forward with your application at this time. We received a high number of qualified applicants, and while your skills and experience are impressive, we have selected a candidate whose qualifications more closely align with the needs of the role.<br><br>Please know that this decision was not made lightly, and we recognize the effort you put into your application. We encourage you to keep an eye on our careers page for future opportunities that match your profile.<br><br>Thank you once again for considering [COM] as a potential employer. We wish you all the best in your job search and future endeavors.<br><br>Sincerely,<br><br>[YOUR_NAME]<br>[COM]<br>[COM_ADDRESS]</p>'),
	(12,'rejected_template_indonesia','Rejected Template Indonesia','<p>[COM_ADDRESS]<br>[DATE]<br><br>[CAN_NAME]<br>[CAN_ADDRESS]<br><br>Kepada,<br>[CAN_NAME]<br><br>Dengan Hormat,<br><br>Terima kasih atas partisipasi Anda dalam proses rekrutmen di [COM]. Setelah melalui proses seleksi yang teliti, kami ingin memberitahukan bahwa kami telah memutuskan untuk tidak melanjutkan proses rekrutmen Anda untuk posisi [JOB_TITLE].<br><br>Kami menghargai waktu dan usaha yang telah Anda dedikasikan untuk menjalani proses seleksi bersama kami. Meskipun Anda tidak dipilih untuk posisi ini, kami ingin mengucapkan terima kasih atas minat dan kualifikasi Anda.<br><br>Kami mendoakan kesuksesan Anda dalam pencarian karir Anda yang lainnya. Semoga Anda dapat menemukan kesempatan yang sesuai dengan harapan dan kualifikasi Anda.<br><br>Salam hormat,<br><br>[YOUR_NAME]<br>[COM]</p>'),
	(13,'interview_template_english','Interview Template English','<p>Dear [CAN_NAME],<br><br>We are delighted to inform you that [COM] is pleased to offer you the opportunity to interview for the position of [JOB_TITLE]. Your application stood out to us, and we believe that your qualifications and experience make you a strong candidate for this role.<br><br>The interview will be conducted via Google Meet. Below are the details for the interview:<br><br>Interview Date &amp; Time: [GMEET_DATE]<br>Google Meet Link: [GMEET_URL]<br><br>If you have any questions or need further information, please do not hesitate to reach out to us.<br><br>Best regards,<br><br>Krisma Bela<br>+62 889-0234-7290<br><strong>Talent Acquisition Supervisor</strong><br><strong>PT Passion Abadi Korpora</strong></p>'),
	(14,'interview_template_indonesia','Interview Template Indonesia','<p>Dear [CAN_NAME],<br><br>We are delighted to inform you that [COM] is pleased to offer you the opportunity to interview for the position of [JOB_TITLE]. Your application stood out to us, and we believe that your qualifications and experience make you a strong candidate for this role.<br><br>The interview will be conducted via Google Meet. Below are the details for the interview:<br><br>Interview Date &amp; Time: [GMEET_DATE]<br>Google Meet Link: [GMEET_URL]<br><br>If you have any questions or need further information, please do not hesitate to reach out to us.<br><br>Best regards,<br><br>Krisma Bela<br>+62 889-0234-7290<br><strong>Talent Acquisition Supervisor</strong><br><strong>PT Passion Abadi Korpora</strong></p>'),
	(15,'accepted_template_english','Accepted Template English','<p>[DATE]<br><br>[CAN_NAME]<br>[CAN_ADDRESS]<br><br>Dear [CAN_NAME],<br><br>On behalf of [COM], I am delighted to offer you the position of [JOB_TITLE]. We were impressed with your qualifications and experience during the interview process, and we believe that you will be a valuable addition to our team.<br><br>The position is a [ARRANGEMENT], [COMMITMENT] role based at [COM_ADDRESS]. Your starting salary will be [OFF_SALARY] per [ARRANGEMENT]. Your anticipated start date will be on [START_DATE].<br><br>Please review this offer carefully and let us know of your acceptance by [ACCEPTANCE_DEADLINE]. If you have any questions or need further clarification, do not hesitate to contact us.<br><br>We are excited about the opportunity to work with you and welcome you to our team..<br><br>Sincerely,<br><br>[YOUR_NAME]<br>[Title]<br>[Company Name]</p>'),
	(16,'accepted_template_indonesia','Accepted Template Indonesia','<p>[DATE]<br><br>[COM]<br>[COM_ADDRESS]<br><br>Kepada,<br>[CAN_NAME]<br>[CAN_ADDRESS]<br><br>Perihal: Surat Penerimaan Rekrutmen<br><br>Dengan hormat,<br><br>Bersama surat ini, kami dari [COM] dengan senang hati ingin mengumumkan bahwa Anda telah diterima sebagai [JOB_TITLE] di perusahaan kami. Kami yakin bahwa Anda akan menjadi aset berharga bagi tim kami.<br><br>Detail pekerjaan Anda adalah sebagai berikut:<br>- Jabatan: [JOB_TITLE]<br>- Lokasi Kerja: [ARRANGEMENT]<br>- Waktu Kerja: [COMMITMENT]<br>- Gaji: [OFF_SALARY] per bulan<br>- Mulai Bekerja: [START_DATE]<br><br><br>Kami berharap Anda dapat bergabung dengan kami dan turut serta berkontribusi dalam mencapai tujuan perusahaan. Jika Anda memiliki pertanyaan lebih lanjut atau perlu klarifikasi, jangan ragu untuk menghubungi saya melalui email atau telepon.<br><br>Atas perhatian dan kerjasama Anda, kami ucapkan terima kasih.<br><br>Hormat kami,<br><br>[YOUR_NAME]<br>[COM]</p>');
